{{Infobox figure skater |name= Bianca Butler |image= Bianca Butler & Joseph Jacobsen 2007 JGP USA.jpg |caption= Butler & Jacobsen in 2007 |country= [[United States]] |birth_date= {{birth date and age|1989|9|2}} |residence= |height= {{convert|163|cm|ft|abbr=on}} |partner= |formerpartner= [[Joseph Jacobsen]] |coach= [[Angela Nikodinov]] |formercoach= [[Todd Sand]], [[Jenni Meno]], [[Alexander Gennadiyevich Zaitsev|Alexander Zaitsev]] |choreographer=[[Renne Rocca]] |skating club= All Year FSC |retired= |combined total= 123.14 |combined date= [[ISU Junior Grand Prix|2006 JGPF]] |SP score= 46.47 |SP date= [[ISU Junior Grand Prix|2006 JGP Norway]] |FS score= 78.84 |FS date= [[ISU Junior Grand Prix|2005 JGP Andorra]] }} '''Bianca Butler''' (born September 2, 1989 in [[Laguna Beach]], [[California]]) is an [[United States|American]] [[pair skater]].
For almost ten years, she competed with [[Joseph Jacobsen]]. They were the [[2007 United States Figure Skating Championships|2007 US National junior silver medalists]]. They qualified for the 2005 [[Junior Grand Prix Final]] in their first year on the circuit, and placed sixth.
Although they placed seventh on the day, they were later moved up a spot to a sixth place finish at the 2007-2008 Junior Grand Prix Final following the retroactive disqualification of first-place-finishers [[Vera Bazarova]] & [[Yuri Larionov]] due to a positive doping sample from Larionov.
Their partnership ended following the 2008-2009 season.
